function searchKeys() {
  var searchWord = document.getElementById('tableInput').value;
  const resultKeys = [];
  var rez = ""
  const regex = new RegExp(searchWord, 'i');
  for (const key in OSC_dic) {
    if (regex.test(key)) {
      resultKeys.push(key);
	  rez += key + "\n"
    }
  }
  console.log(resultKeys)
  document.getElementById('tableFound').value = rez;
  
}

function goToTable() {
	var urlArray = [];
    var rawText = document.getElementById('tableSelected').value;
    var serachWord = rawText.split("|");

    var finalArray = []

    for (var i = 0; i < serachWord.length; i++) {
        if (serachWord[i] != "") {
            finalArray.push(serachWord[i])
        }
    }
    console.log(finalArray)
	
	
	    for (var j = 0; j < finalArray.length; j++) {
		console.log(OSC_dic[finalArray[j]])
		        chrome.tabs.create({
            url: OSC_dic[finalArray[j]]
        });
    }
	
}



document.getElementById('tableDetails').addEventListener('click', goToTable);
document.getElementById('tableInput').addEventListener('input', searchKeys);